Querying MongoDB to return 5 most recent records (Mongoose framework)<p>I'm trying to query my MongoDB to return the 5 most recent records. I have Mongoose as my framework and using Node.js as my server. I have the model here:</p>

<pre><code>var Schema = mongoose.Schema;
var uGardenDataModel = new Schema({
temp: String,
humidity: String,
soilMoisture: String,
light: String,
timestamp: Date,
});
// Create model
var uGardenData = mongoose.model('UGarden', uGardenDataModel);
</code></pre>

<hr>

<p>My function to query the DB is here:</p>

<pre><code>function getChartData(res){
//uGardenData.find({},{sort: {_id:-1}},limit: 5, function(err, post){
    uGardenData.find({sort:{'timestamp': -1}},{limit: 5}, function(err, post){
    if(err){
        res.send({success: false});
        console.log('failed');
    } else {
        res.send({data:post,success:true});
        console.log('success');
    }
})
